let patients = document.querySelector('#patients').dataset.user;
patients = JSON.parse(patients);
    
var markerGroup = L.layerGroup().addTo(map);

var centerMed=[];
var centerMedCant=[];

 for (var i in patients) {

    if (centerMed.length == 0 || !centerMed.includes(patients[i]['id'])){
        
        centerMed.push(patients[i]['id']);
        centerMedCant.push(0);
    }
}
for (var i in patients) {
    for (var j in centerMed) {
        if (centerMed[j]==patients[i]['id']) {
           centerMedCant[j] =centerMedCant[j]+1;
        }
    }
}

function isMarkerInsidePolygon(marker, poly) {
    var polyPoints = poly.getLatLngs();       
    var x = marker.getLatLng().lat, y = marker.getLatLng().lng;

    var inside = false;
    for (var i = 0, j = polyPoints.length - 1; i < polyPoints.length; j = i++) {
        var xi = polyPoints[i].lat, yi = polyPoints[i].lng;
        var xj = polyPoints[j].lat, yj = polyPoints[j].lng;

        var intersect = ((yi > y) != (yj > y))
            && (x < (xj - xi) * (y - yi) / (yj - yi) + xi);
        if (intersect) inside = !inside;
    }

    return inside;
};

var magGroup = L.layerGroup().addTo(map);
var orienteGroup = L.layerGroup().addTo(map);
var norteGroup = L.layerGroup().addTo(map);
var occidenteAGroup = L.layerGroup().addTo(map);
var occidenteBGroup = L.layerGroup().addTo(map);
var centroGroup = L.layerGroup().addTo(map);

function points(subregion) {
    var ini=0;

    for (var i in patients) {

        for (var j= ini; j < centerMed.length; j++) {
            if(patients[i]['id']==centerMed[j]){
                var lat=parseFloat(patients[i]['lat']);
                var long=parseFloat(patients[i]['long']);
                var marker=L.marker([lat,long]).bindPopup(
                "<b>Nombre del centro medico:</b> "+
                patients[i]['medical_center_name']+
                "<br><b>Cantidad de pacientes:</b>"+
                centerMedCant[j]);

                if (subregion=='all') {
                    marker.addTo(markerGroup);    
                }else{
                    if (subregion=='mag' && isMarkerInsidePolygon(marker, polygon2)) {
                        marker.addTo(magGroup);  
                    }else if (subregion=='oriente' && isMarkerInsidePolygon(marker, polygon3)) {
                        marker.addTo(orienteGroup); 
                    }else if (subregion=='norte' && isMarkerInsidePolygon(marker, polygon4)) {
                        marker.addTo(norteGroup); 
                    }else if (subregion=='occidenteA' && isMarkerInsidePolygon(marker, polygon5)) {
                        marker.addTo(occidenteAGroup); 
                    }else if (subregion=='occidenteB' && isMarkerInsidePolygon(marker, polygon6)) {
                        marker.addTo(occidenteBGroup); 
                    }else if (subregion=='centro' && isMarkerInsidePolygon(marker, polygon7)) {
                        marker.addTo(centroGroup); 
                    }
                    
                }
                
                ini=ini+1
            } 
        }
    }
}


